        selectedProject :0
    },
    skills: {},
    navDisplay: 'closed',
    contactDisplay: false,
    form: {},
}

export const reducers = (state=initalState, action) => {
    console.log('hi')
    console.log(action.type)
    switch(action.type){  

        case 'TOGGLE_CLOSE': {


            return {
                ...state, navDisplay: 'closed'
            }
        }
        case 'TOGGLE_OPEN': {

            return {
                ...state, navDisplay: action.payload
            }
        }
        case 'FORM_VALUE' : {
            return {
                ...state, form: action.payload
            }
        }

        default :{
            return state;
        }

    }


}
